import { tickets } from "../scripts/data";

let arr = [];
let sortedArr = [];

tickets().then((data) => {
  data.forEach((element) => {
    arr.push(element.price);
  });
});

function comp(a, b) {
  return a - b;
}

sortedArr = arr.sort(comp);

sortedArr.sort(comp);

export default sortedArr;
